TV3 Ireland's Vice Girls
TV3's investigative journalist Paul Connolly goes undercover in an attempt to infiltrate Ireland's booming prostitution industry. It is said that over a quarter of a billion euro passes through the hands of punters, prostitutes and pimps every year. Paul Connolly Investigates tries to gain access into a profession neatly tucked away in the lawless shadows of Irish society. Sex trafficking is now a national issue, with many vulnerable women, the majority migrants being manipulated and forced into &quot;white slavery&quot;. How can a young and beautiful girl possibly enjoy some old man, with bad breath and sagging skin, lying on top of her body and penetrating her? This prospect really beggars belief. Paul Connolly Investigates offers an informative guide to Ireland's sleazy sex trade. Connolly separates fact from fiction, coming face to face with the vice kings who run it. The devil lies in the detail, as Connolly brings an industry that is rotten to its core into sharper focus. It is a truly remarkable and eye opening investigation into a trade less ordinary than the rest.

